const List = (props) => {
    return (
        <>
            <div>
            <span className='listindex'>{props.showindex}.</span>
            <li className="list-group-item list-group-flush" >
                
                <span style={{marginLeft:'10%'}}>{props.listvalue}</span>

                    
            </li>
            <button className="material-symbols-outlined btn btn-primary" style={{float:'right'}}>delete</button>
            </div>
            
            
        </>
    );
}
export default List;
